import React from 'react';

export default () => {

    return (
        <div>
            <header class="bg-primary text-white">
                <div class="container text-center">
                <h1>UCH 健行科大 - 前端網頁程式設計</h1>
                <p class="lead">A landing page template freshly redesigned for Bootstrap 4</p>
                </div>
            </header>
        </div>
    )
}
